import React from "react";

function MatchTypeSelector() {
  return (
    <div>
      <div className="row">
        <div className="col-sm-1"></div>
        <div className="col-sm-3">Hi</div>
        <div className="col-sm-2"></div>
      </div>
    </div>
  );
}

export default MatchTypeSelector;
